    false,nt"url": null,nt"notes": "This project is supported in the McNary
    CCP by Goal 7a: Improve Shrub-Steppe Condition. The strategy is to reduce competition
    of yellow starthistle to native grasses and forbs. This project will provide funding
    for a contracted weed crew to conduct a large scale (600 acre) fall herbicide (Chaparral)
    treatment on yellow starthistle. Fall application of Chaparral provides control
    of yellow starthistle as well as suppression of cheat grass. Project will include
    4 acres of plug planting for areas with low presence of native grasses.",nt"license_title":
